package main

import (
	"bufio"
	"fmt"
	"os"
	"strings"
	"time"
)

// 0.018ì´ˆ
func main() {
	l := ""
	writer := bufio.NewWriter(os.Stdout)
	defer writer.Flush()
	start := time.Now()
	defer func() {
		fmt.Printf("Elapsed: %v ms\n", float64(time.Since(start).Microseconds())/1000)
	}()

	freq := make(map[byte]int)
	for i := 0; i < len(l); i++ {
		c := l[i]
		if c >= 'a' && c <= 'z' {
			freq[c]++
		}
	}

	maxCnt := 0
	result := byte('?')
	for k, v := range freq {
		if v > maxCnt {
			maxCnt = v
			result = k
		} else if v == maxCnt {
			result = '?'
		}
	}

	fmt.Fprintf(writer, "%c\n", strings.ToUpper(string(result))[0])
}
